INSERT INTO "sheet" ("id", "uid", "name", "description", "url", "image") VALUES
	(1, 'UXNoFYjoJJxHbeRTu7YD3z', 'Striver SDE Sheet Problems', '<p>Striver SDE Sheet contains the most popular coding questions asked during SDE interviews. This sde sheet will help you prepare for your subsequent prominent placement! Here is a list of Strivers-SDE-sheet problems people have successfully solved to land their dream jobs. Solve this sde sheet and crack DSA rounds of top MNCs. Best of luck!!</p>', 'https://www.naukri.com/code360/problem-lists/striver-sde-sheet-problems', NULL),
	(2, 'eX9D4FoLNtcjA3iAK3CCNV', 'Ninjas SDE Sheet', '<p>Ninjas SDE Sheet is your gateway to acing SDE interviews! Packed with essential coding challenges frequently encountered in top-tier company interviews, this sheet is your trusty companion for major placement preparations. Discover a curated collection of problems that have helped many aspirants secure their ideal roles. Dive into the SDE Sheet, conquer the DSA challenges, and prepare to shine in interviews with leading MNCs. Best wishes for your coding adventures!</p>', 'https://www.naukri.com/code360/problem-lists/ninjas-sde-sheet', NULL),
	(3, 'XQigUYAhja2DCY3GP4iSgq', 'Top Salesforce Coding Interview Questions', 'Salesforce Coding Interview Questions cover various topics like popular DSA questions. It also contains many problem-solving skills. Salesforce coding questions help the candidate to write efficient and scalable code. A vast amount of Salesforce Interview Questions are available here to help you crack interviews at Salesforce. Practice solving these questions to gain confidence and get the dream job role.', 'https://www.naukri.com/code360/problem-lists/top-salesforce-coding-interview-questions', NULL),
	(4, 'iP9cLFvZhUWq2EzGFEot3g', 'Zoho Interview Questions', '<p>Ace the Zoho coding interview by solving the Zoho interview questions exclusively on CodeStudio with a range of practice problems.</p>', 'https://www.naukri.com/code360/problem-lists/zoho-interview-questions', NULL),
	(5, 'YDebAK2XNqjuV6cZKdXwE7', '45 Day Coding Challenge', 'Take advantage of your summer holiday by signing up for the 45 Day Coding Challenge and taking part in the challenge. Make the best of this summer. Solve one problem at a time, and crack your dream job!', 'https://www.naukri.com/code360/problem-lists/45-day-coding-challenge', NULL),
	(6, '4tGLeiezRXCm22Di3xkoCM', 'Arsh Goyal''s 7 Day Placement Challenge', 'This challenge is mainly designed to help students, and professionals prepare for  internships and placements.You can also attempt this challenge if you are on your DSA learning journey. This challenge will help you revise concepts and also give you a good idea of the concepts that you need to work on. 
